//here I am passing addressId to my next service GetCusotemrByAddressId
import com.eviware.soapui.support.XmlHolder
def response = context.testCase.getTestStepByName("CreateCustomer").getPropertyValue("response")
def holder = new XmlHolder(response)
def addressid = holder.getNodeValue("//*:item/id")
log.info addressid
context.testCase.setPropertyValue("addressId",addressid)

